import React from "react";
import { StyleSheet,
  Text, 
  StatusBar,
  Button,
  TouchableWithoutFeedback, 
  Alert, 
  View, 
  SafeAreaView, 
  Image, 
  Platform,
  Dimensions,
} from 'react-native';

export default function Signin() {
  
  return (
    <View style={{
      backgroundColor:"red",
      flex:1,
      flexDirection:"row",
      justifyContent:"center",
      alignItems: "center",
      paddingTop: Platform.OS === "android" ? 30:0,
      flexWrap:"wrap",
    }}>
      <Image source={require("../assets/logo1.png")} style={{width: 100}}/>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#2f2f32',
    // alignItems: 'center',
    // justifyContent: 'center',
    // paddingTop: Platform.OS === "android" ? 30:0,
  },
});
